import React from 'react';
import 'survey-react/survey.css';
import * as Survey from 'survey-react';
import Json from './questions';

const TheSurvey = (prop) => {
    return(
        <Survey.Survey
        // stops the deafult page from showing up
        showCompletedPage={false}
        //controls what gets showed when the page is completed
        onCompletePage={data=>prop.showCompletedPage(data.valuesHash)}
        //imports the questions for the survey
        json={Json}  />
    )
}

export default TheSurvey;
